function Get-ShellContent
{
<#
	.SYNOPSIS

	This script leverages modified strings2 to extract the input and output of any commandline process, running or dumped, encrypted or plaintext.
	he script has a ComputerName parameter which allows it to be executed against multiple computers.
	
	Function: Get-ShellContent
	Author: Eyal Neemany (@Zwiitzer). http://www.javelin-networks.com
	Strings2:  glmcdona. http://split-code.com/strings2.html
	License:  https://opensource.org/licenses/BSD-3-Clause
	Required Dependencies: Strings2 (included)
	Optional Dependencies: None
	Version: 1.1c
	Strings2 version: 1.1

	.PARAMETER ProcessID
	Specify The conhost.exe ProcessID you want to scan (OPTIONAL)
	
	.PARAMETER ProcDump
	Specify the path of the proccess dump file you want to analyze (OPTIONAL)
	
	.PARAMETER Deep
	Analyzes all shells processes, False positive will occur (BETA, OPTIONAL)
	
	.PARAMETER ComputerName
	Specify the remote computername or IP to run this script on (Mandatory to remote)
	
	.NOTES
	Written by Eyal Neemany, Javelin Networks 2017
	Tested on PowerShell, CMD, MySQL, Python, Empire, NPS, WScript
	
	.Example
	Get-ShellContent -ProcessID 3833 (Scans PID 3833 conhost process for any shells)
	Get-ShellContent (Scans all the conhost processes on current endpoint)
	Get-ShellContent -ProcDump "c:\temp\conhost.dmp" (Analyze process dump file)
	Get-ShellContent -ComputerName "192.168.1.33" -ProcessID 3833 (Scans PID 3833 conhost processes on remote endpoint, with WinRM)
#>
	Param(
	  [int]$ProcessID=0,
	  [string]$ComputerName="localhost",
	  [string]$ProcDump="null",
	  [switch]$Deep,
	  [bool]$InternalParm=$true
	)

	$Loader64Block = {
	$EncodedCompressedFile = @'

'@
	$DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedFile),[IO.Compression.CompressionMode]::Decompress)
	$UncompressedFileBytes = New-Object Byte[](1240064)
	$DeflatedStream.Read($UncompressedFileBytes, 0, 1240064) | Out-Null
	try
	{
		if([Reflection.Assembly]::Load($UncompressedFileBytes))
		{
		write-host "DLL LOADED SUCCESSFULLY" -ForegroundColor Red -BackgroundColor Black;
		$MyCompObj = New-Object Strings2Managed.Strings2ManagedWrapper;
		}
	}
	catch
	{
		write-host "Dll loading failed" -ForegroundColor Red
	}

	function CH-PIDExtract ($procid)
	{
		if ($MyCompObj)
		{
		$MyCompObj.ProcessToStrings($procid)
		}
	}
	}

	$Loader32Block = {
	$EncodedCompressedFile = @'

'@
	$DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedFile),[IO.Compression.CompressionMode]::Decompress)
	$UncompressedFileBytes = New-Object Byte[](1113600)
	$DeflatedStream.Read($UncompressedFileBytes, 0, 1113600) | Out-Null
	try
	{
		if([Reflection.Assembly]::Load($UncompressedFileBytes))
		{
			write-host "DLL LOADED SUCCESSFULLY" -ForegroundColor Red -BackgroundColor Black;
			$MyCompObj = New-Object Strings2Managed.Strings2ManagedWrapper;
		}
	}
	catch 
	{
		write-host "Dll loading failed" -ForegroundColor Red
	}

	function CH-PIDExtract ($procid)
	{
		if ($MyCompObj)
		{
		$MyCompObj.ProcessToStrings($procid)
		}
	}
	}


	function LogoArt
	{
		$asciiart = @"
 __           _            _  _
 \ \     ___ | |__    ___ | || |
  \ \   / __|| '_ \  / _ \| || |
  / /   \__ \| | | ||  __/| || |
 /_/    |___/|_| |_| \___||_||_|
 
"@
		return $asciiart
	}

	if($InternalParm)
	{
		write-host (LogoArt) -ForegroundColor Magenta
	}

	if($InternalParm -and $ComputerName -ne "localhost")
	{
		if($ScriptPath -eq "null")
		{
			Write-Host "flag -ScriptPath with the .ps1 script path is missing, it's mandatory to execute it remotely" -ForegroundColor Red
		}
		else
		{
			Write-Host "Intiating Remote Connection with" $computerName -ForegroundColor Red -BackgroundColor Black
			$Session = new-pssession -computerName $ComputerName
			$OSArch = Invoke-Command -Session $Session -ScriptBlock {([IntPtr]::Size)}
			if($OSArch -eq 8) 
			{
				Invoke-Command -Session $Session -ScriptBlock $Loader64Block
			}
			else 
			{
				Invoke-Command -Session $Session -ScriptBlock $Loader32Block
			}
		}
	}
	if($InternalParm -and $computerName -eq "localhost")
	{
		if(([IntPtr]::Size) -eq 8)
		{
			invoke-command -scriptblock $Loader64Block
		}
		else
		{
			invoke-command -scriptblock $Loader32Block
		}
	}

	function CH-FalsePositive ($line)
	{
		if($line.StartsWith("5WFP Built-in IPsec Inbound Transport v4 Layer"))
		{
			return $true
		}
		if($line.StartsWith("> pMicrosoft (R)"))
		{
			return $true
		}
		if ($line -like "*XPADDINGPADDINGXXPADDING*")
		{
			return $true
		}
		if ($line -like "*buyticket9.asp*")
		{
			return $true
		}
		if ($line -like "*2005 Dolby Laboratories*")
		{
			return $true
		}
		if($line.StartsWith("> Microsoft Corporation/(C)"))
		{
			return $true
		}
		return $false
	}

	function CH-PIDExtract ($procid)
	{
		$MyCompObj = New-Object Strings2Managed.Strings2ManagedWrapper
		if ($MyCompObj)
		{
		$MyCompObj.ProcessToStrings($procid)
		}
	}
	
	function CH-FileExtract ($filepath)
	{
		$MyCompObj = New-Object Strings2Managed.Strings2ManagedWrapper
		if ($MyCompObj)
		{
		$MyCompObj.FileToStrings($filepath)
		}
	}
	
	function CH-SimiliarString ($line)
	{
		$halfchar = $line[$line.length/2]
		$quarchar = $line[$line.length/4]
		$thirdchar = $line[$line.length/3]
		if ($line[0] -eq $line[2] -and $line[1] -eq $halfchar -and $line[1] -eq $quarchar -and $line[1] -eq $thirdchar)
		{
			return $false
		}
		return $true
	}
	
	if($ProcessID -eq 0 -and $ProcDump -eq "null")
	{
		$Shells = @()
		write-host "No Process ID Entered, Scanning all shells!" -ForegroundColor Red -BackgroundColor Black
		Write-Host ""
		$ProcessList = @("conhost.exe","wscript.exe")
		$DeepProc = @("conhost.exe","wscript.exe","cmd.exe","powershell.exe","python.exe","pythonw.exe")
		$ExcludedNames = @("SensorDBSynch.exe","node.exe","QuickControl.exe","fdhost.exe","wlanext.exe","fsnotifier.exe","postgres.exe")
		$ExcludedPIDs = @()
		$CurrentPID = ([System.Diagnostics.Process]::GetCurrentProcess()).Id
		if($Deep)
		{
			$ProcessList = $DeepProc
		}
		try
		{
		$Plist = gwmi win32_process -computername $computername 
		$ExcludedPIDs += ($Plist | where-Object {$ExcludedNames -contains $_.Name}).ProcessId
		$PIDList = $Plist | where-Object {$ProcessList -contains $_.Name -and $CurrentPID -ne $_.ParentProcessId -and !($ExcludedPIDs -contains $_.ParentProcessId)} | select ProcessId, ParentProcessId
		}
		catch
		{
			Write-Warning "Couldn't find any Processes to analyze."
		}
		ForEach ($cpid in $PIDList)
		{
			if($pid -ne $cpid.ProcessId)
			{
				Get-ShellContent -ProcessID $cpid.ProcessId -computername $computername -InternalParm $false
			}
		}
	break
	}
	
	$res = @()
	$smack = @()
	$dope = @()
	$wshell = $false
	
	# Extraction of the running or dumped processes
	if($ProcDump -ne "null")
	{
		Write-Host "Scanning Dump:" $ProcDump -ForegroundColor Green -BackgroundColor Black
		$smack += CH-FileExtract $ProcDump
	}
	else
	{
	write-host ""
	Write-Host "Scanning PID:" $ProcessID -ForegroundColor Green -BackgroundColor Black
		if($computername -ne "localhost")
		{
			$smack += (Invoke-Command -ScriptBlock {CH-PIDExtract -procid $args[0]} -Session $Session -ArgumentList $ProcessID)
		}
		else
		{
			$smack += (CH-PIDExtract -procid $ProcessID)
		}
	}
	
	$dope = ($smack | Select-String -Pattern "\w:\\(\w,\\,\d)*>|mimikatz #| All rights reserved." -Context 0,1) -replace "\s{12,}","`n" 
	foreach ($line in $dope) 
	{
		if(($line.Length -gt 169) -and (CH-SimiliarString $line) -and !(CH-FalsePositive $line))
		{
			$res += $line
		}
	}
	
	# Unique Shells
	if($res.length -eq 0)
	{
		foreach ($line in $smack) 
		{
			if($line.Length -gt 2800 -and (CH-SimiliarString $line) -and !(CH-FalsePositive $line))
			{
				$res += ($line -replace "\s{14,}","`n")
			}
		}
	}
	
	# WScript Dumped Shells
	if($res.length -eq 0)
	{
		foreach ($line in $smack)
		{
			if(($line | Select-String -Pattern "VBScript - script block") -or $wshell)
			{	
				if($wshell -eq $true)
				{
				$res += $line
				}
				$wshell = $true
			}
		}
		$wshell = $false
	}
	write-host ""
	return $res
}
